```json
{
  "application": "jupyter",
  "details": {
    "environment": "conda",
    "environment_name": "jupyter_dask",
    "resource_requirements": {
      "partition": "compute",
      "cores": 4,
      "memory": 16GB,
      "time": "23:00:00",
      "account": "innovation"
    },
    "ssh_connection": {
      "host": "login.delftblue.tudelft.nl",
      "user": "${USER}"
    },
    "jupyter_lab_options": {
      "port": "${port}",
      "ip": "${node}",
      "no_browser": true
    }
  }
}
```

**Explanation:**

* **Application:** The script is designed to run a Jupyter Lab server. 
* **Environment:** The script uses a conda environment named "jupyter_dask". This indicates a Jupyter environment likely configured with the Dask library for parallel computing.
* **Resource Requirements:** The script requests resources from a cluster using the SLURM workload manager. It requires a specific partition ("compute"), 4 cores, 16GB of memory, a runtime of 23 hours, and an account named "innovation".
* **SSH Connection:** The script provides instructions on how to establish an SSH tunnel to access the Jupyter Lab server running on the remote machine. 
* **Jupyter Lab Options:**  The script launches Jupyter Lab with specific options, including running it without opening a browser (`--no-browser`), using a specific port and IP address.
